import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the Electronics category card
    // This selector is specific, targeting a div with class 'category-card' that contains the text 'Electronics'
    const electronicsCategoryCard = page.locator('div.category-card:has-text("Electronics")');
    await electronicsCategoryCard.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCategoryCard.click();

    // Take a screenshot after clicking the category
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_clicked.png'));

    return {
      success: true,
      action: "Navigated to the Electronics category by clicking the category card.",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to the Electronics category.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
